import axios from "axios"



export default function fetchTodos() {

    return (dispatch) => {

  axios.get('http://localhost:3333/person')
  .then(function (response) {
    // handle success
    dispatch({ type: 'todos/todosLoaded', payload: response.person })
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })
  .then(function () {
    // always executed
  });

}

}
